Patch Set 7:

for db_sync version is positional, so it will be:

  manage db_sync <version>


for upgrade, downgrade:

  manage db upgrade --version <version>


Me point is that non-positional args is parsed, but is not passed to actual functions, so for example:


   def upgrade(self, version=None):
        """Upgrade the database's migration level"""
        migration.upgrade(version)


Will always be performed with None
